✨Bare skin appreciation moment✨
I find my self-critical voice to be very loud these days…(anyone else??👀) So in the spirit of self-love, sharing some post-gym car selfies I like, plus swipe to the end for an extra cringey selfie I found from about 5 years ago 😜✌🏼we love a skin journey!

I still have texture, visible pores that tend to get oily, sun damage, and now a fun little skin tag that popped up during my pregnancy😑👍🏼, but I’m proud of my skin glow up!

I’ll do something more in depth on my actual skincare routine, but my top 3 must haves are: 

@cetaphilus facial cleanser 
@garnierusa micellar water 
@janmariniskinresearch products 

If you actually happen to read this far, share something about yourself you love and/or are proud of !❤️
